# @lc code=start
import collections
from operator import index
from typing import List


class Solution:
    def minJumps(self, arr: List[int]) -> int:
        indexs = collections.defaultdict(list)
        for i, a in enumerate(arr):
            indexs[a].append(i)
        
        n = len(arr)
        
        visited = set([0])
        queue = collections.deque()
        queue.append([0, 0])
        while queue:
            idx, step = queue.popleft()
            if idx == n - 1:
                return step
            u = arr[idx]
            step += 1
            for i in indexs[u]:
                if i not in visited:
                    visited.add(i)
                    queue.append([i, step])
            del indexs[u]
            if idx + 1 < n and idx + 1 not in visited:
                visited.add(idx + 1)
                queue.append([idx + 1, step])
            if idx - 1 >= 0 and idx - 1 not in visited:
                visited.add(idx - 1)
                queue.append([idx - 1, step])
        
        return step

